="39" QFormat="true" Name="TOC Heading"/>\n </w:LatentStyles>\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!-- [if gte mso 10]>\n&lt;style&gt;\n /* Style Definitions */\n table.MsoNormalTable\n {mso-style-name:"Table Normal";\n mso-tstyle-rowband-size:0;\n mso-tstyle-colband-size:0;\n mso-style-noshow:yes;\n mso-style-priority:99;\n mso-style-qformat:yes;\n mso-style-parent:"";\n mso-padding-alt:0in 5.4pt 0in 5.4pt;\n mso-para-margin-top:0in;\n mso-para-margin-right:0in;\n mso-para-margin-bottom:10.0pt;\n mso-para-margin-left:0in;\n line-height:115%;\n mso-pagination:widow-orphan;\n font-size:11.0pt;\n font-family:"Calibri","sans-serif";\n mso-ascii-font-family:Calibri;\n mso-ascii-theme-font:minor-latin;\n mso-fareast-font-family:"Times New Roman";\n mso-fareast-theme-font:minor-fareast;\n mso-hansi-font-family:Calibri;\n mso-hansi-theme-font:minor-latin;}\n&lt;/style&gt;\n<! endif]--&gt;<span >Beberapa sutradara, perlu storyboard untuk menterjemahkan tulisan penulis dalam bentuk visual sebelum diambil gambarnya, untuk lihat potensi kesalahan dan kesuakaran pengambilan gambar, supaya ada solusi. </span></p>\n<p> </p>', 'unpublished', '2015-08-18 16:04:24', '2015-09-03 11:04:42', NULL),
(17, 1, 38, 50, 'Bagaimana kamu memasarkan diri kamu sendiri? Personal Branding #1', 'personal branding #1, diri sendiri, keistimewaan, keunggulan, persepsi, emosi, unik, karakter, membangun, peluang, tantangan', '<p>Mungkin banyak sekali aspek dalam proses pemasaran diri atau sering disebut <em>Personal Branding. </em>Disini kami akan coba menjelasakan beberapa aspek tersebut.</p>\n<p><em><strong>1. Personal Branding is about perception and hope</strong></em><br /><br />Personal Branding bisa diartikan persepsi atau emosi yang dimiliki seseorang mengenai kita. Personal branding dapat juga diartikan harapan yang tercipta dalam pikiran audien sasaran. Jadi, cari keunggulan atau kualitas yang sudah diakui, paling tidak oleh komunitasmu atau nilai-nilai yang menurut orang lain dimiliki olehmu. Mulailah perhatikan orang-orang disekitarmu, apa yang mereka tangkap dan akui dari dirimu.<br /><br /><em><strong>2. Find your strength, and passion!</strong></em><br /><br />Personal branding mampu memperlihatkan keistimewaan dan keunggulan kita dalam bidang tertentu. Personal branding adalah cerminan dari kemampuanmu, keunggulanmu, serta reputasimu. Jadi, carilah apa yang menjadi bakat, minat, atau keahlianmu lalu persiapkan dirimu, bukan kita membuat sesuatu yang mungin sulit dibuat melainkan apa yang kita punya lalu kita mengasahnya supaya lebih baik.<br /><br /><em><strong>3. Be Unique, be different, be skilled?</strong></em><br /><br />Percayalah bahwa setiap orang itu unik. Keunikan itu menjadi modal dasar membangun personal brand yang kuat. Kembangkan keunikan itu secara tepat, maka kita akan terlihat otentik, berbeda dengan yang lain dan menjadi menarik.<br /><br /><em><strong>4. Be honest and build the positive one</strong></em><br /><br />Tidak harus punya bakat dan keahlian. Karakter kita bisa menjadi kelebihan kita. Bangun brand yang membuat kita dikenal sebagai orang yang terbuka, ramah, dan suka membantu. Tentu saja ini harus dilakukan dengan tulus dan jujur, karena bila kita memaksakan diri untuk membuat-buat kepribadian kita, cepat atau lambat orang juga akan mengetahuinya. Jadilah diri sendiri bukan orang lain.<br /><br /><em><strong>5. Grab your chance and challenge!</strong></em><br /><br />Satu yang penting dalam membangun personal brand adalah berani mengambil berbagai peluang dan tantangan. Ada tantangan tentu harus berani ambil resikonya. Resiko? Di awal membangun personal brand akan dibutuhkan banyak waktu untuk berkonsentrasi pada bidang yang kita minati atau karakter yang kita bangun. Sebagian harus mengorbankan profesi awalnya dan 100% terjun ke bidang yang diminatinya, jika brand yang diinginkan berkaitan dengan suatu keahlian tertentu</p>', 'published', '2015-08-17 23:43:03', '2015-09-12 21:02:35', NULL),
(21, 3, 38, 107, 'Apa Itu Fotografi, Tahukah Kalian?', 'fotografi, kamera, gerakan, merekam, melukis, cahaya, menulis, potret', '<p style=''text-align: justify;'' data-mce-style=''text-align: justify;''><strong>Kalian mungkin sering mendengar kata <em>Fotografi</em>?</strong></p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>Tahu kah kalian<em> Fotografi</em> berasal dari bahasa Inggris <em>photography</em>, atau berasal dari kata Yunani yaitu <em>photos</em> ialah cahaya dan <em>grafo</em> ialah melukis/menulis jadi fotografi dapat diartikan proses melukis/menulis dengan menggunakan media cahaya. Sebagai istilah umum, <em>fotografi</em> berarti proses atau metode untuk menghasilkan gambar atau foto dari suatu obyek dengan merekam pantulan cahaya yang mengenai obyek tersebut pada media yang peka cahaya. Alat populer untuk menangkap cahaya ini adalah kamera. Tanpa cahaya, tidak ada foto yang bisa dibuat.</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>Prinsip fotografi adalah memokuskan cahaya dengan bantuan pembiasan sehingga mampu membakar medium penangkap cahaya. Medium yang telah dibakar dengan ukuran luminitas cahaya yang tepat akan menghasilkan bayangan identik dengan cahaya yang memasuki medium pembiasan (selanjutnya disebut lensa).</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>Untuk menghasilkan intensitas cahaya yang tepat untuk menghasilkan gambar, digunakan bantuan alat ukur berupa <em>lightmeter</em>. Setelah mendapat ukuran pencahayaan yang tepat, seorang fotografer bisa mengatur <em>intensitas</em> cahaya tersebut dengan mengubah kombinasi ISO/ASA (<em>ISO Speed</em>), diafragma (<em>Aperture</em>), dan kecepatan rana (<em>speed</em>). Kombinasi antara ISO, Diafragma &amp; <em>Speed</em> disebut sebagai pajanan (<em>exposure</em>).<br></p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>1. Pengukur cahaya (<em>lightmeter)</em> <br></p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>Pengukur cahaya atau <em>lightmeter</em> adalah sebuah alat untuk mengukur intensitas cahaya. Dalam fotografi, pengukur cahaya digunakan untuk menentukan pembukaan. Diberikan kecepatan film dan kecepatan rana, alat ini akan menunjukkan f-stop yang akan memberikan sebuah pembukaan yang netral.</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>2. Lensa</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>Dalam fotografi, lensa berfungsi untuk memokuskan cahaya hingga mampu membakar medium penangkap (film). Di bagian luar lensa&nbsp; biasanya terdapat tiga cincin, yaitu cincin panjang fokus (untuk lensa&nbsp; jenis variabel), cincin diafragma, dan cincin fokus.</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>3. Panjang Lensa</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>Panjang lensa&nbsp; biasa disebut Focal Length, panjang lensa mempengaruhi jarak pemotretan, sudut pandang, pembesaran dan fasilitas bukaan diafragma. Lensa Khusus :<br></p><ul style=''text-align: justify;list-style-type: circle;'' data-mce-style=''text-align: justify;''><li>Lensa Makro (biasa disebut <em>Macro Lens</em>)</li><li>Penambahan panjang lensa (biasa disebut <em>Tele Converter</em> atau Extender)</li><li>Lensa pengoreksian perspektif pada subjek</li><li>Lensa Lunak (biasa disebut Soft Focus Lens)</li></ul><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>4. Macam - Macam Lensa</p><ul style=''text-align: justify; list-style-type: circle;'' data-mce-style=''text-align: justify;''><li>Lensa Standar. Lensa ini disebut juga lensa normal. Berukuran 50 mm dan memberikan karakter bidikan natural.</li><li>Lensa Sudut-Lebar (Wide Angle Lens). Lensa jenis ini dapat digunakan untuk menangkap subjek yang luas dalam ruang sempit. Karakter lensa ini adalah membuat subjek lebih kecil daripada ukuran sebenarnya. Dengan menggunakan lensa jenis ini, di dalam ruangan kita dapat memotret lebih banyak orang yang berjejer jika dibandingkan dengan lensa standar. Semakin pendek jarak fokusnya, maka semakin lebar pandangannya. Ukuran lensa ini beragan mulai dari 17 mm, 24 mm, 28 mm, dan 35 mm.</li><li>Lensa Fish Eye. Lensa fish eye adalah lensa wide angle dengan diameter 14 mm, 15 mm, dan 16 mm. Lensa ini memberikan pandangan 180 derajat. Gambar yang dihasilkan melengkung.</li><li>Lensa Tele. Lensa tele merupakan kebalikan lensa wide angle. Fungsi lensa ini adalah untuk mendekatkan subjek, namun mempersempit sudut pandang. Yang termasuk lensa tele adalah lensa berukuran 70 mm ke atas. Karena sudut pandangannya sempit, lensa tele akan mengaburkan lapangan sekitarnya. Namun hal ini tidak menjadi masalah karena lensa tele memang digunakan untuk mendekatkan pandangan dan memfokuskan pada subjek tertentu.</li><li>Lensa Zoom. Merupakan gabungan antara lensa tandar, lensa wide angle, dan lesa tele. Ukuran lensa idak fixed, misalnya 80-200 mm. Lensa ini cukup fleksibel dan memiliki range lensa ang cukup lebar. Oleh karena itu lensa zoom banyak digunakan, sebab pemakai tinggal memutar ukuran lensa sesuai dengan yang dibutuhkan.</li><li>Lensa Makro. Lensa makro biasa digunakan untuk memotret benda yang kecil.</li></ul><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>5. Fokus</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''><span id=''733211051162358521''>Fokus adalah bagian yang mengatur jarak ketajaman&nbsp;lensa&nbsp;sehingga gambar yang dihasilkan tidak berbayang..</span></p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>6. Shutter Speed</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''><em>Shutter Speed</em> atau kecepatan rana merupakan kecepatan terbukanya jendela kamera sehingga cahaya dapat masuk ke dalam image sensor. Satuan dari pada <em><em>Shutter Speed</em></em> adalah detik, dan sangat tergantung dengan keadaan cahaya saat pemotretan. Semisal cahaya terang pada siang hari, maka <em>Shutter Speed</em> harus disesuaikan menjadi lebih cepat, semisal 1/500 detik. Sedangkan untuk malam hari yang cahayanya lebih sedikit, maka <em><em>Shutter Speed</em></em> harus disesuaikan menjadi lebih lama, semisal 1/5 detik. Hal ini sekaligus menjelaskan mengapa foto pada malam hari cenderung buram, bahwa <em>Shutter Speed</em> yang lebih lambat memungkinkan pergerakan kamera akibat getaran tangan menjadikan cahaya bergeser sehingga foto menjadi buram / blur.</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>7. Aperture</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''><em>Aperture</em> atau diafragma merupakan istilah untuk bukaan lensa. Apabila diibaratkan sebagai jendela, maka diafragma adalah kiray / gordyn yang dapat dibuka atau ditutup untuk menyesuaikan banyaknya cahaya yang masuk. Pada kamera <em>Aperture </em>dilambangkan dengan huruf&nbsp; F&nbsp; kecil dan dengan satuan sebagai seperti f/1.2, f/1.4, f/1.8, f/2.0, f/2.8,f/3.5, f/4.0 dan lainnya<br><br>Semakin kecil angka satuan maka akan semakin besar bukaan lensa contoh misalkan (f/1.4 lebih besar bukaannya dibandingkan dengan f/4.0,&nbsp; f/2,8 lebih besar bukaannya dibandingkan dengan f/16).<br><br>Jadi, korelasi antara S<em>hutter Speed</em> dan <em>Aperture </em>adalah bahwa semakin besar bukaan lensa maka S<em>hutter Speed</em> akan semakin cepat, sebaliknya semakin kecil bukaan lensa maka shutter speed akan semakin melambat.</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>Sumber :</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>https://id.wikipedia.org/wiki/Fotografi</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>https://id.wikipedia.org/wiki/Pengukur_cahaya</p><p style=''text-align: justify;'' data-mce-style=''text-align: justify;''>https://id.wikipedia.org/wiki/Fotografer</p>', 'published', '2015-09-13 10:57:25', '2015-09-13 11:55:55', NULL),
(18, 1, 38, 51, 'Bagaimana kamu memasarkan diri kamu sendiri? Personal Branding #2', 'personal branding #2, diri sendiri,promosi, berbagi, share it, membangun, kompetisi, usaha keras', '<p>Kembali lagi pada permasalahan pemasaran diri <em>(Personal Branding). </em>Ada beberapa aspek lagi yang mungkin bisa membangun anda supaya menjadi lebih percaya diri, lanjut kita bahasa saja :</p>\n<p><em><strong>6. Promote yourself!</strong></em><br /><br />Punya personal brand yang jempol saja tidaklah cukup. Kamu harus membuat orang lain tahu bahwa kamulah pemiliknya. Sayangnya, masih banyak dari kita yang malu mempromosikan diri kita. Masih ragu dengan kemampuan kita. Banyak orang yang memiliki permasalahan ini, mereka punya kemampuan tapi kemampuan mereka tidak diketahui orang lain. Bagaimana kita menyelesaikan permasalahan ini? Mungkin anda bisa ikut dalam berorganisasi, komunitas atau kegiatan yang mungkin berhubungan dengan kemampuan anda.<br /><br /><em><strong>7. Don’t Wait!</strong></em><br /><br />Mulailah membangun personal brandmu sekarang juga. Jangan ditunda lagi. Tentu saja membangun personal brand bukan hal mudah. Tidak pula instan. Dibutuhkan kerja keras, pembelajaran, dan hasrat untuk menjalaninya. Yang pasti butuh ketelatenan yang luar biasa.Semakin dini membangun personal brand semakin bagus, bukan?<br /><br /><em><strong>8. Share It!</strong></em><br /><br />Suatu personal brand diciptakan untuk dibagi, bukan untuk ditimbun. Ini adalah aset yang berharga yang akan semakin berkembang bila makin banyak digunakan, terutama untuk menolong komunitasmu. Semakin banyak digunakan untuk membantu, maka akan semakin kuat brand itu dan semakin dikenal. Jadi, jangan ragu untuk berbagi dengan orang lain entah itu ilmu atau pengalaman kalian dalam bidang tertentu, monggo dicoba karena dampaknya sangat luar biasa! <br /><br /><em><strong>9. Be patient!</strong></em><br /><br />Tidak ada keberhasilan instant! Di antara banyaknya kompetisi bakat yang bisa membuat orang jadi beken dengan instantnya, sepertinya kita perlu tanamkan pengertian bahwa tidak ada keberhasilan instant. Nikmatilah proses menuju keberhasilan anda.</p>\n<p><strong>RUMUS PERSONAL BRANDING</strong><br /><br />Jangan lupa ingat ini, Kekuatan <em><strong>(Strength), </strong>Kelemahan<strong> (Weakness), </strong>Peluang<strong> (Opportunity) dan </strong>Ancaman<strong> (Threat)<br /></strong></em></p>\n<p>Semoga bermanfaat untuk kalian semua yang membacanya, tunjukan diri kalian diatas muka bumi ini, bahwa negara <strong>Republik Indonesia</strong> ini memliki orang seperti kalian!</p>', 'published', '2015-08-17 23:44:10', '2015-09-12 21:29:27', NULL),
(19, 2, 38, 52, 'Apa itu Sinemetografi dan Apa itu Film?', 'sinematografi, film, movie, sinematografer, video, gerakan, merekam, frame', '<p><strong>Apa itu Sinemetografi, Tahu kah anda  ... ?</strong><br /><br /><strong>Sinematografi</strong> dari bahasa yunani kinema adalah gerakan dan graphein adalah merekam jadi mungkin bisa diartikan seperti ini, suatu disiplin dalam menata cahaya dan sudut pandang kamera untuk menciptakan kualitas gambar yang indah dalam sebuah produksi film atau sinema. Secara etimologi sinematography berarti menulis dengan gambar bergerak.</p>\n<p>Sedangkan orang yang bertanggung jawab semua aspek Visual dalam pembuatan sebuah film adalah <em>Sinematografer</em>. Nah pekerjaan mereka mencakup sebagai berikut :</p>\n<ul>\n<li>Proses komunikasi melalui lisan atau gerakan antara dua atau lebih pembicara yang tak dapat menggunakan simbol-simbol yang sama. <em>(Interpretasi)</em> visual pada skenario.</li>\n<li>Pemilihan jenis Kamera.</li>\n<li>Jenis bahan baku yang akan dipakai.</li>\n<li>Pemilihan lensa.</li>\n<li>Pemilihan jenis filter yang akan dipakai di depan lensa atau di depan lampu.</li>\n<li>Dan pemilihan lampu dan jenis lampu yang sesuai dengan konsep sutradara dan cerita dalam skenario.</li>\n</ul>\n<p>Seorang sinematografer juga memutuskan gerak kamera, membuat konsep Visual, membuat floorplan untuk ke efisienan pengambilan gambar. Artinya seorang sinematografer adalah orang yang bertanggung jawab baik secara teknis maupun tidak teknis di semua aspek visual dalam film.</p>\n<p>Sinematografer harus mendukung visi dari sutradara dan skenario, karena bagaimanapun yang akan di sampaikan ke pada penonton adalah semua informasi dalam bentuk Visual yang sesuai dengan visi sutradara dan visi skenario walaupun di beberapa kasus, sutradara bisa mengubah jalan cerita dalam skenario demi keindahan bercerita yang sudah merupakan gaya sutradara tersebut.</p>\n<p><strong>Apa itu Film?</strong></p>\n<p>Dari pembahasan <em>Sinematografi</em> pasti tidak jauh dari pembahasan kata film, apa menurut kalian film itu?<br /><br />Secara fisik mungkin merupakan pita seluloid (Selulosa Triacetate), secara optik, film merupakan susunan gambar yang berurutan yang menghasilkan ilusi gerak dan secara konsep, film merupakan perpaduan gambar, suara dan gerak.<br /><br /><strong>Film</strong> merupakan rangkaian dari beberapa bingkai gambar (frame) yang diputar dengan cepat kadang juga bisa disebut gambar hidup juga sering disebut <em>Movie</em>. Masing-masing bingkai merupakan rekaman tahap-tahap (sekuen) suatu gerakan. Frame gambar yang berurutan tersebut ketika diputar secara cepat, kemudian dilihat oleh mata kita lalu diteruskan ke dalam otak.</p>\n<p>Film dihasilkan dengan rekaman dari orang dan benda (termasuk fantasi dan figur palsu) dengan kamera, dan/atau oleh animasi. Susunan gambar yang dibutuhkan per detik dalam sebuah gerakan disebut <em><strong>Frame Rate.</strong></em></p>\n<p>Film juga mempunyai banyak jenis genre, seperti Horor, Action, Drama, Thriller, Komedi, Animasi, Fantasi, Romansa.</p>\n<p>Sumber :</p>\n<p>https://id.wikipedia.org/wiki/Sinematografi</p>\n<p>https://id.wikipedia.org/wiki/Film</p>', 'published', '2015-08-18 00:10:23', '2015-09-13 12:11:25', NULL);
