(5, 'Ace Hardware untuk Indonesia - ACE Hardware Video Competition', 'Ace Hardware (Organization), Indonesia (Country), Kepo, Abis,  Kepoabis, Video, Bangsa, Pembangunan, Negeri, Kepo Abis', '<p >Indonesia kaya akan alamnya, juga kaya akan budayanya. Bersatu padu membangun ibu pertiwi agar tradisi dan budaya tetap dijunjung tinggi. Ace Hardware untuk Indonesia. @KepoAbisCom via http://kepoabis.com</p>', 'video', '', 'assets/img/video/img (1).jpg', '2015-06-06 08:21:22', '2015-08-24 07:49:12', NULL),
