(7, 'Enjoy Jakarta Enjoy Your Day, Nikmati Caramu', 'enjoy jakarta, enjoy your day, jakarta, kepo abis, indonesia, macet, traffic jam, tips, tutorial', '<p>Pada suatu hari ada seorang lelaki yang ingin mengunjungi pacarnya yang tinggal di Jakarta. Tapi ketika sampai di Jakarta, yang dijumpai hanyalah macet. Kemudian, beliau mencoba menikmati macet dengan caranya sendiri. Di video ini beliau memberitahu tips-tips yang sangat berguna ketika anda menghadapi macet.</p>\n<p>Macet?. gak usah stres, nikmati dengan caramu sendiri.</p>', 'video', '', 'assets/img/video/img (3).jpg', '2015-06-06 08:21:22', '2015-08-23 21:34:21', NULL),
(8, 'Like Father Like Daughter', 'like, father, daughter, keluarga, orang tua, pendidikan', '<p>...</p>', 'video', '', 'assets/img/video/img (4).jpg', '2015-06-06 08:21:22', '2015-09-12 23:48:52', NULL),
(9, 'Harta, Tahta, & Wanita', 'harta, tahta, wanita, korupsi, corruption', '<p>...</p>', 'video', '', 'assets/img/video/img (5).jpg', '2015-06-06 08:21:22', '2015-07-21 03:36:28', NULL),
(10, 'An Impacting Life', 'Film Pendek, Short Movie, Film, Drugs, Narkoba, Free Sex', '<p> ...</p>', 'video', '', 'assets/img/video/img (6).jpg', '2015-06-06 08:21:22', '2015-07-21 03:26:29', NULL),
(11, 'Jeruji Besi', 'Film Pendek, Short Movie, Film, Drugs, Police, Polisi, Pengedaran Narkoba, Narkoba', '<p >Cerita ini bermula ketika seorang suami yang bernama Yogi yang menjadi suspek pengedaran dadah dan telah dimasukan kedalam penjara. Ia merasa menyesal dan teringat semula dengan kejadian yang telah berlaku sebelumnya.</p>\r <p >Yogi dan Santi adalah sepasang suami isteri yang telah menikah setahun lepas. Mereka tinggal berdua di rumah yang sederhana. Yogi merupakan suami yang tidak memiliki pekerjaan, atau biasa disebut pengangguran.</p>\r <p >Pada suatu hari sang istri sudah bosan dan geram terhadap suami yang tidak juga mendapatkan pekerjaan dan sang istri cuba memprotes suaminya. Tetapi sang suami memarahinya semula. </p>\r <p >Akhirnya sang suami pergi meninggalkan rumah untuk mencari pekerjaan dan membuktikan kepada isterinya bahawa dia boleh mendapatkan pekerjaan dan wang. Tetapi pekerjaan yang dipilih oleh suami adalah salah. Dia lebih memilih jalan pintas untuk mendapatkan wang dengan cara haram, iaitu menjadi pengedar dadah. Selama suami menjadi seorang pengedar, sang isteri tidak pernah tahu bahawa suaminya adalah seorang pengedar. </p>\r <p >Masalah datang ketika sang suami melakukan rasuah daripada hasil penjualan dadah. Selain itu semasa sang suami menjadi pengedar dadah dia telah diekori oleh dua orang polis. Selepas itu apa yang akan berlaku ketika sang suami menghadapi kedua-dua masalah ini?. Dapatkah dia melaluinya?.</p>', 'video', '', 'assets/img/video/img (7).jpg', '2015-06-06 08:21:22', '2015-07-21 03:20:20', NULL),
(12, 'Intro KepoAbis.com', 'Intro, kepoAbis.com, Short Movie, Documenter, Traveling, Education, Entertainment, Experimental, Vlogger, Serba-serbi, Kepo Abis, Haamill Productions', '<p >Seni merupakan suatu wadah untuk menyalurkan hobi dan juga kreativitas manusia yang di lakukan dengan tujuan untuk memberikan sebuah hiburaan, keindahan serta rasa ketertarikan bagi pelaku seni maupun orang yang menikmatinya, salah satu unsur seni yang sering kita jumpai dalam masyarakat adalah dalam bentuk audio visual. Selain itu kecenderungan masyarakat untuk memanfaatkan teknologi sebagai media berekspresi melahirkan beragam bentuk seni yang menghibur, inovatif dan juga inspiratif dimana dibentuk dalam sebuah tayangan yang menarik. Dan, perkembangan era digital saat ini memicu kami untuk membuat sebuah sarana berbagai informasi menarik dan juga kreatif yang dikemas dalam bentuk audio visual. </p>\r <p >Tujuan kami adalah Menjadi komunitas digital yang tidak hanya unik, namun menghibur tetapi kritis, nyeleneh, tetapi inspiratif, dan tentunya "up to date".</p>\r <p >Jadi kepoers let''s join us and enjoy our video! @KepoAbisCom via http://kepoabis.com</p>', 'video', '', 'assets/img/video/img (8).jpg', '2015-06-06 08:21:22', '2015-07-21 03:15:27', NULL),
(13, 'The Youthpreneur Your future is your choice #VirusWirausaha', 'the youthpreneur your future, VirusWirausaha, bank mandiri, entrepreneur', '<p >"The Youthpreneur. Your future is your choice", </p>\r <p >video dibuat untuk turut serta dalam lomba video 1 menit Bank Mandiri - KDRI. Keterangan lomba : http://www.kdri.co/wirausahamandiri</p>', 'video', '', 'assets/img/video/img (9).jpg', '2015-06-06 08:21:22', '2015-07-21 03:45:00', NULL),
