(15, 'Kepoin Kuliner - Takeya The Japanese Restaurant, Bintaro', 'Japanese Cuisine (Cuisine), kuliner, takeya, japanese restaurant, bintro, jakarta, delicious', '<p>Kali ini Fani bersama Tim Kepoin Kuliner pengen ngajak kalian ke bilangan Bintaro, tepatnya di 9 Walk Bintaro. Katanya disana ada restoran Jepang yang bahan-bahannya di impor langsung dari negeri sakura tersebut. Penasaran ?. Ikut kita kepoin restoran itu yuk.....</p>', 'video', '', 'assets/img/video/img (11).jpg', '2015-06-06 08:21:22', '2015-07-21 04:44:54', NULL),
