(20, 'Kepoin Kuliner - Takeya The Japanese Restaurant, Bintaro', 'videografi, basic', '<p>Kali ini Team Kepoabis akan kuliner bersama nih kawan dibilangan bintaro. pengen lihat masakan apa yang ada disana? </p>\n<p> </p>\n<p>Yuk tonton Kepoin Kuliner kita...</p>', 'article', '', 'assets/img/article/img (11).jpg', '2015-06-06 08:21:22', '2015-07-21 23:49:24', NULL),
