(28, 'FORMASI 2015', 'Formasi 2015, High School (School Category), SMA, MAN, MAN 4 Jakarta', '<p>Forum Award OSIS (FORMASI)</p>\n<p>(forum debat antar pengurus OSIS SMA/MA/sederajat se-Jabodetabek sebagai wadah bersilaturahim, berkompetisi, dan menyalurkan pikiran kritis dan kreatif)</p>\n<p> </p>\n<p>FORMASI adalah Forum debat pertama yang diadakan SMA/MA/sederajat.</p>\n<p> </p>\n<p>Konsep acara ini mirip dengan forum debat yang banyak ditayangkan di televisi. Dengan meja-meja bundar, topik menarik, dan moderator handal, FORMASI hadir tak kalah dengan acara debat yang ada di televisi.</p>\n<p> </p>\n<p>Kenapa harus ikut FORMASI?</p>\n<p>Dengan ikut FORMASI kalian bisa bertemu dengan orang-orang hebat yang tergabung dalam OSIS dari berbagai sekolah dengan berbagai macam latar belakang. Mereka akan membawa pikiran-pikiran kritisnya masing-masing. Begitu juga dengan kalian. Dan yang paling penting, kalian akan mendapatkan ilmu dan pengalaman sekali seumur hidup.</p>\n<p> </p>\n<p>Berani Ikut FORMASI?</p>\n<p>Ayo segera daftarkan sekolah kalian!!</p>\n<p>Kuota Peserta Terbatas!!</p>\n<p> </p>\n<p>Caranya sms/email ke </p>\n<p>? 085772168868 (Akbar Rizqullah)</p>\n<p>? 082231588530 (Ilham Shidqi)</p>\n<p>? osisman4jakarta@gmail.com </p>\n<p> </p>\n<p>dengan format</p>\n<p>Nama Sekolah;Nama Lengkap Peserta;Nama Lengkap Partisipan lain*;</p>\n<p>Contact Personyang bisa dihubungi</p>\n<p> </p>\n<p>Produced, Directed by KepoAbis.com</p>\n<p>https://www.youtube.com/channel/UCjCQDSEsDTqq7wmth70khLQ</p>\n<p> </p>\n<p>FACEBOOK : http://www.facebook.com/kepoabiscom</p>\n<p>TWITTER: http://twitter.com/kepoabiscom</p>\n<p>INSTAGRAM: @kepoabiscom</p>\n<p>EMAIL: haamill.productions@gmail.com</p>\n<p> </p>\n<p>Jangan lupa untuk Like and Subscribe yaa kepoers!!</p>\n<p>Sampai jumpa di vlog kami berikutnya.</p>\n<p>KepoAbis.com, Always make you curious...</p>', 'video', '', 'assets/img/video/img (17).jpg', '2015-06-06 08:21:22', '2015-09-12 23:41:34', NULL),
