(36, 'Kepoin Event - Ragunan Zoo Application', 'Event,indosat,Ragunan, Kebun Binatang, Zoo Application,kegiatan', '<p><strong>Jakarta Selatan, KepoAbis.com</strong> - PT. Indosat dan Kepo Abis yang diwakili oleh beberapa anggotanya melakukan liputan dalam acara Launching Product terbaru (Application) PT. Indosat, liputan yang diadakan pada hari sabtu (30/05), di Kebun Binatang Ragunan Jakarta Selatan ini berjalan dengan baik.</p>\n<p>Produced, Directed by KepoAbis.com</p>\n<p><a href="../../../videografi/view/2015/06/19/24/kepoin-event---ragunan-zoo-application">Kepoin Event - Ragunan Zoo Application</a> - <a href="https://play.google.com/store/apps/details?id=com.inovidea.zooapp">Download Zoo Application</a></p>', 'news', '20.57', 'assets/img/news/669550e6511bee860ca1e981d5b1da7e.png', '2015-07-20 05:20:24', '2015-09-13 09:51:25', NULL),
(37, 'Formasi 2015', 'Videografi, basic', '<p>Kepoers, tau kan sekarang ini lagi nge-hits banget sebuah tayangan debat yang ditayangkan di berbagai televisi swasta? Forum debat tersebut pada dasarnya diselenggarakan untuk membahas dinamika perpolitikan negeri kita, dan diikuti oleh para tokoh politik di Indonesia.</p>\n<p>Nah kini forum debat juga dapat diikuti oleh siswa-siswi lho. Yap, Madrasah Aliyah Negeri (MAN) 4 Jakarta melakukan sebuah terosoban baru, yakni dengan menghadirkan sebuah forum debat antar SMA/MA/Sederajat. Forum debat ini dinamakan FORMASI. Lalu apa sih FORMASI? Seperti apa kegiatannya? Kamu dapat menyaksikan tayangannya di rubrik videografi :)</p>', 'article', '57.22', 'assets/img/article/98393769a3415aa51c8c6f68f8b017a5.jpg', '2015-07-20 15:27:52', '2015-08-11 13:23:37', NULL),
