(38, 'Kepo Abis Buka Bersama Indosat Community - Jakarta Selatan', 'Kepo Abis, kepo, abis, Buka Bersama, Indosat, Community, komunitas, kegiatan, kerjasama', '<p><strong>Jakarta Selatan, KepoAbis.com</strong> - KepoAbis.com bersama dengan PT. Indosat (yang diwakili oleh Community Indosat Sales Jakarta Selatan) melakukan kegiatan buka puasa bersama sekaligus untuk membahas mengenai kerjasama antara kedua komunitas. Nah selain membahas kerjasama, pertemuan yang diadakan pada hari Kamis (09/07), di rumah makan Raden Bahari Mampang ini juga bertujuan untuk mengenal lebih jauh komunitas-komunitas yang tergabung dengan Indosat di wilayah Jakarta Selatan.</p>', 'news', '303.8', 'assets/img/news/304cb753cef83e79a0bcdd3187b0250e.JPG', '2015-07-22 20:38:17', '2015-09-13 09:39:29', NULL),
(39, 'Basic Training #1 ke Puncak Bogor (31 Juli 2015 - 2 Agustus 2015)', 'Basic, Training #1, Bogor, Juni, Agustus, 2015, kegiatan, erat, solidaritas, permainan', '<p><strong>Jakarta Timur, KepoAbis.com</strong> -  Seluruh squad KepoAbis.com akan mengadakan Basic Training pertamanya, pada hari Jum''at - Minggu (31 Juli-2 Agustus 2015), di daerah Puncak, Bogor. Yap, kegiatan ini bertujuan untuk saling mendekatkan antara para squad (terutama bagi squad yang baru bergabung). Ngga cuma sekedar training dasar, kegiatan ini juga bakalan diisi dengan games menarik dan lomba video antar kelompok. Ga kebayang nanti serunya bakal seperti apa :D</p>', 'news', '72.55', 'assets/img/news/9f22c63e83e63c3b9856d930e42ddf8f.jpg', '2015-07-23 08:15:07', '2015-09-13 09:14:01', NULL),
(41, 'Curious Camp (Puncak, 31 Juli 2015 - 2 Agustus 2015)', 'camp, training, games, puncak, kegiatan, erat, solidaritas, permainan', '<p><strong>Bogor, KepoAbis.com</strong> - Ini dia salah satu kegiatan luar biasa yang dijalani oleh crew KepoAbis.com. Yap, Curious Camp, sebuah kegiatan basic training yang ditujukan untuk para crew yang baru bergabung. Pada kegiatan ini, para crew dibekali teori dasar dan praktek seputar videografi, mulai dari tahap Pre Production hingga Post Production bahkan ada pengenalan mengenai sejarah terbentuknya KepoAbis.com. Ngga hanya itu, seluruh crew juga dibekali oleh ilmu Personal Branding, yakni bagaimana caranya menjadi individu yang berkualitas.</p>\n<p>Yang membuat Curious Camp beda dan menarik, disini para crew ngga hanya dibekali oleh teori dan praktek seputar videografi saja, namun para crew juga diajak untuk mengikuti games-games seru. Games ini bukan sembarang games lho kepoers, disini para crew dituntut akan kekompakannya dan kerjasama tim dalam memenangkan games-games tersebut. Setelah rangkaian kegiatan training selesai, diadakan sesi barbeque yang dihibur oleh atraksi berjalan diatas bara api, yang bertujuan untuk mengasah mental seluruh crew yang mengikuti training ini.</p>\n<p>Nah menarik bukan? So, tunggu kegiatan luar biasa dari kami selanjutnya :)</p>', 'news', '314.8', 'assets/img/news/c1c38bed276516eaf9176467b0462d60.JPG', '2015-08-10 11:37:03', '2015-09-13 09:13:34', NULL),
(42, 'Video Greeting HKN 2015 - KepoAbis.com', 'Greeting HKN, Hari Komunitas, Nasional, KepoAbis.com, Kepo, Abis, Kepo Abis', '<p>Video Greeting @WikiDPR. Kita turut berpartisipasi, berkolaborasi dan berkarya menyambut Hari Komunitas Nasional 2015 #ActionForNation #ICN2015</p>', 'video', '35.97', 'assets/img/video/01cb9fd570b3ca53c69e57b722b8fd92.jpg', '2015-08-13 09:12:49', '2015-09-12 23:52:45', NULL),
(43, 'SELAMAT HUT RI KE-70 Untuk Semua Warga Indonesia', 'SELAMAT HUT RI KE-70, HUT RI KE-70, Indonesia, potensi, nasionalisme, masa depan, negara kita', '<p>Kami ingin mengucapkan SELAMAT HUT RI KE-70 untuk semua warga Indonesia. Semoga diusia Indonesia yang ke-70 ini, Indonesia dapat lebih mengembangkan potensi di dunia industri kreatif!!! Dannnn #SalamKepoAbis ???????????? #HUTRI70<br />#INDONESIA</p>', 'news', '40.58', 'assets/img/news/e9ba4e002cf296fa3e02cd4ffa8e0f00.jpg', '2015-08-17 08:52:53', '2015-09-13 09:10:22', NULL),
