(50, 'Bagaimana kamu memasarkan diri kamu sendiri? Personal Branding #1', 'personal branding #1, diri sendiri, keistimewaan, keunggulan, persepsi, emosi, unik, karakter, membangun, peluang, tantangan', '<p>Mungkin banyak sekali aspek dalam proses pemasaran diri atau sering disebut <em>Personal Branding. </em>Disini kami akan coba menjelasakan beberapa aspek tersebut.</p>\n<p><em><strong>1. Personal Branding is about perception and hope</strong></em><br /><br />Personal Branding bisa diartikan persepsi atau emosi yang dimiliki seseorang mengenai kita. Personal branding dapat juga diartikan harapan yang tercipta dalam pikiran audien sasaran. Jadi, cari keunggulan atau kualitas yang sudah diakui, paling tidak oleh komunitasmu atau nilai-nilai yang menurut orang lain dimiliki olehmu. Mulailah perhatikan orang-orang disekitarmu, apa yang mereka tangkap dan akui dari dirimu.<br /><br /><em><strong>2. Find your strength, and passion!</strong></em><br /><br />Personal branding mampu memperlihatkan keistimewaan dan keunggulan kita dalam bidang tertentu. Personal branding adalah cerminan dari kemampuanmu, keunggulanmu, serta reputasimu. Jadi, carilah apa yang menjadi bakat, minat, atau keahlianmu lalu persiapkan dirimu, bukan kita membuat sesuatu yang mungin sulit dibuat melainkan apa yang kita punya lalu kita mengasahnya supaya lebih baik.<br /><br /><em><strong>3. Be Unique, be different, be skilled?</strong></em><br /><br />Percayalah bahwa setiap orang itu unik. Keunikan itu menjadi modal dasar membangun personal brand yang kuat. Kembangkan keunikan itu secara tepat, maka kita akan terlihat otentik, berbeda dengan yang lain dan menjadi menarik.<br /><br /><em><strong>4. Be honest and build the positive one</strong></em><br /><br />Tidak harus punya bakat dan keahlian. Karakter kita bisa menjadi kelebihan kita. Bangun brand yang membuat kita dikenal sebagai orang yang terbuka, ramah, dan suka membantu. Tentu saja ini harus dilakukan dengan tulus dan jujur, karena bila kita memaksakan diri untuk membuat-buat kepribadian kita, cepat atau lambat orang juga akan mengetahuinya. Jadilah diri sendiri bukan orang lain.<br /><br /><em><strong>5. Grab your chance and challenge!</strong></em><br /><br />Satu yang penting dalam membangun personal brand adalah berani mengambil berbagai peluang dan tantangan. Ada tantangan tentu harus berani ambil resikonya. Resiko? Di awal membangun personal brand akan dibutuhkan banyak waktu untuk berkonsentrasi pada bidang yang kita minati atau karakter yang kita bangun. Sebagian harus mengorbankan profesi awalnya dan 100% terjun ke bidang yang diminatinya, jika brand yang diinginkan berkaitan dengan suatu keahlian tertentu</p>', 'article', '177.74', 'assets/img/article/33630a0f2846546e5b2c5dcb4fd4948c.JPG', '2015-08-17 23:43:03', '2015-09-12 21:02:35', NULL);
