(53, 'Apa itu Pre-Production?', 'pre-production, video, film, ide, script writing, story board', '<p>Hallo Kepoers!! Kali ini kami akan sharing wawasan mengenai tahap-tahap dalam pembuatan video atau film lho. So, tetap baca artikel ini hingga bagian akhir ya :D</p>\n<p>Ada beberapa tahap yang harus dikerjakan oleh para produsen film atau video dalam meghasilkan sebuah karya. Tahap pertama yakni pre-production, kemudian production, dan yang terakhir adalah post-production. Nah tulisan ini akan mengupas dari A-Z mengenai pre-production. Lalu apa itu pre-production?</p>\n<p>Pre-production, dari sebutannya aja kita udah bisa mengartikan secara sederhana. Yap, pre berarti sebelum dan production berarti produksi, jadi pre-production adalah tahap yang dikerjakan sebelum kita memulai proses produksi/pembuatan film atau video. Pre production dibagi lagi menjadi beberapa tahap, yakni menentukan ide, sinopsis, script writing, story board, time schedule, serta pemilihan crew dan pemain. Oke kita bahas satu per satu tahapannya:</p>\n<p>1. Ide</p>\n<p>Kepoers, sebelum menentukan ide apa yang akan kita ambil dalam pembuatan film atau video, hal pertama yang harus kita tentukan adalah tujuan. Apa tujuan kita dalam membuat film atau video? Apakah hanya sekedar hiburan, pembelajaran, pendidikan, atau untuk menyampaikan sebuah pesan moral. Nah dari tujuan inilah kita akan dengan mudah menentukan ide dalam pembuatan film atau video.</p>\n<p>Selain itu, kita juga harus menentukan siapa target penonton yang akan kita sasar, apakah untuk anak-anak, kaum remaja, orang tua, atau semua kalangan. So, tujuan dan target penonton adalah 2 aspek penting yang terlebih dahulu harus kamu tentukan demi memudahkan kamu untuk mengambil ide-ide dalam pembuatan film atau video. Ide dalam pembuatan film mencakup banyak hal, misalnya genre apa yang akan kita buat, jalan cerita yang seperti apa yang ingin kita rancang, dst. </p>\n<p>2. Sinopsis</p>\n<p>Sinopsis merupakan gambaran cerita secara keseluruhan. </p>\n<p>3. Script Writing </p>\n<p>Yap ini adalah tahap dimana sinopsis sudah mulai dirancang dan dikembangkan menjadi sebuah naskah. Orang yang berperan dalam tahap ini kita kenal dengan sebutan Script Witer. Seorang sript writer dituntut untuk membuat sebuah naskah cerita yang menguraikan urut-urutan adegan, tempat, keadaan, dan dialog, yang disusun dalam konteks struktur dramatik. Seorang penulis skenario dituntut untuk mampu menerjemahkan setiap kalimat dalam naskahnya menjadi sebuah gambaran imajinasi visual</p>\n<p>4. Story Board</p>\n<p>&lt;!-- [if gte mso 9]>&lt;xml&gt;\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:DontVertAlignCellWithSp/>\n   <w:DontBreakConstrainedForcedTables/>\n   <w:DontVertAlignInTxbx/>\n   <w:Word11KerningPairs/>\n   <w:CachedColBalance/>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val="Cambria Math"/>\n   <m:brkBin m:val="before"/>\n   <m:brkBinSub m:val="--"/>\n   <m:smallFrac m:val="off"/>\n   <m:dispDef/>\n   <m:lMargin m:val="0"/>\n   <m:rMargin m:val="0"/>\n   <m:defJc m:val="centerGroup"/>\n   <m:wrapIndent m:val="1440"/>\n   <m:intLim m:val="subSup"/>\n   <m:naryLim m:val="undOvr"/>\n  </m:mathPr></w:WordDocument>\n&lt;/xml&gt;&lt;![endif]--&gt;</p>\n<p>&lt;!-- [if gte mso 9]>&lt;xml&gt;\n <w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="true"\n  DefSemiH