(88, 'Birthday of MAN 4 (BOFMAN 4) part 7 2015 - Guest Star', 'Birthday of MAN 4, MAN 4 Jakarta, Bofman, Guest Star, Bofman 4, Part 7, 2015', '<p>Dalam rangka merayakan ulang tahunnya, MAN 4 Jakarta mengadakan Birthday of MAN 4 (BOFMAN 4) PART 7. Ini adalah Acara tahunan yang diselenggarakan oleh OSIS/PPK MAN 4 Jakarta dan akan hadir Pentas Seni (Pensi) yang akan menghadirkan Guest Star. Penasaran ...</p>\n<p><strong>RIGEN (MC) | NIDJI | D''LUBERU | THE BANERY | VELLAROSE | SEMUT MERAH | KAMAR BELAKANG</strong></p>\n<p>Berikut ini video promosi acara Brithday Of MAN (BOFMAN)<br /><br />Jangan lupa dateng ke acara ini mulai Hari Sabtu s/d Sabtu, 29 Agustus 2015 - 5 September 2015.<br /><br />Di MAN 4 Jakarta, GOR UIN, dan SAG Pamulang.<br /><br />#SalamKepoAbis</p>', 'video', '116.11', 'assets/img/video/610802a8c950666e4f3d677f3d093e5e.jpg', '2015-08-24 09:57:24', '2015-08-27 20:04:17', NULL),
(89, 'Birthday of Man 4 (BOFMAN 4) 2015', 'MAN 4 Jakarta, Bofman, Birthday of Man 4, Brithday, Of, MAN 4, Bofman 4, part 7, 2015', '<p>Birthday of MAN 4 (BOFMAN 4) PART 7 2015.  Yuk ikutin acaranya banyak berbagai perlombaan dan pertandingan disana. Seperti <em><strong>Marveloustra, Really Photo, AL-INS CUP, Manga Vocal Jepang, 4th ALMODE CUP, I - Tech Competition, MAN 4 Open dan WAR-E</strong></em><br /><br />Selain itu tentu saja akan hadir Pentas Seni (Pensi) yang akan menghadirkan Guest Star. Dibawah ini :</p>\n<p><em><strong>RIGEN (MC) | NIDJI | D''LUBERU | THE BANERY | VELLAROSE | SEMUT MERAH | KAMAR BELAKANG</strong></em><br /><br />Jangan lupa dateng ke acara ini mulai Hari Sabtu s/d Sabtu, 29 Agustus 2015 - 5 September 2015.<br /><br />Di MAN 4 Jakarta, GOR UIN, dan SAG Pamulang.</p>\n<p>#SalamKepoAbis</p>', 'video', '134.22', 'assets/img/video/8d05eb11cb53c56ef5a1339dd9976dcf.jpg', '2015-08-26 08:04:08', '2015-08-27 20:03:50', NULL),
(90, 'BOFMAN4 PART 7: Competition', 'MAN 4 Jakarta, BOFMAN4 Part7, competition, futsal, manga, itech, fotografi', '<p>Hallo Kepoers!! Udah tau kan kalo MAN 4 Jakarta akan mengadakan kegiatan spektakuler mulai tanggal 29 Agustus-5 September 2015. Yap, kegiatan ini dinamakan BOFMAN 4 (Part 7). Kegiatan ini diselenggarakan dalam rangka memperingati hari ulang tahun MAN 4 lho Kepoers. Nah selain mendatangkan Guest Star yang ngehits, BOFMAN4 Part 7 ini juga mengadakan berbagai kegiatan menarik, seperti Bazaar Creative, Saman Performance, dan yang ngga kalah penting adalah BOFMAN4 Part 7 Competition.</p>\n<p>Nah kita kasih bocoran ni mengenai BOFMAN4 Part 7 Competition. Disini ada berbagai perlombaan yang akan diselenggarakan, mulai dari bidang seni, olahraga, dan juga teknologi. Penasaran apa aja perlomaannya? Langsung aja saksikan videonya :)</p>\n<p>#SalamKepoAbis</p>', 'video', '52.69', 'assets/img/video/071f9ca0c1d39298d18d7a35f7eecb8f.jpg', '2015-08-27 01:27:55', '2015-08-27 01:27:55', NULL),
