(91, 'BOFMAN4 PART 7: Competition', 'Bofman 4, Bofman, MAN 4 Jakarta, BOFMAN4 Part7, competition, futsal, manga, itech, fotografi', '<p>Hallo Kepoers!! Udah tau kan kalo MAN 4 Jakarta akan mengadakan kegiatan spektakuler mulai tanggal 29 Agustus-5 September 2015. Yap, kegiatan ini dinamakan BOFMAN 4 (Part 7). Kegiatan ini diselenggarakan dalam rangka memperingati hari ulang tahun MAN 4 lho Kepoers. Nah selain mendatangkan Guest Star yang ngehits, BOFMAN4 Part 7 ini juga mengadakan berbagai kegiatan menarik, seperti Bazaar Creative, Saman Performance, dan yang ngga kalah penting adalah BOFMAN4 Part 7 Competition.</p>\n<p>Nah kita kasih bocoran ni mengenai BOFMAN4 Part 7 Competition. Disini ada berbagai perlombaan yang akan diselenggarakan, mulai dari bidang seni, olahraga, dan juga teknologi. Penasaran apa aja perlombaannya? Yuk langsung aja saksikan videonya :)</p>\n<p>#SalamKepoAbis</p>', 'video', '76.04', 'assets/img/video/c2e989cecf38ed0a9878e715a9c6eace.jpg', '2015-08-27 01:31:53', '2015-08-28 08:26:02', NULL),
