(101, 'Marveloustra - Kompetisi Band antar SMA/MA Se-Jabotabek', 'Marveloustra, Kompetisi, Band, Juri, Juara, BOFMAN 4', '<p>Jakarta, KepoAbis.com - Hai Kepoers, tau ngga sih kalo kemarin telah diadakan kompetisi band antar SMA Se-Jabodetabek di salah satu SMA di Jakarta. Yap, kali ini Madrasah Aliyah Negeri (MAN 4) Jakarta mengambil peran sebagai salah satu SMA yang turut melestarikan bakat-bakat musik para siswa-siswi SMA di Jabodetabek, dengan menyelenggarakan kompetisi band yang bertemakan "Marveloustra". Kompetisi merupakan salah satu rangkaian kegiatan dari Birthday of MAN 4 (BOFMAN 4) Part 7, dan diikuti oleh 13 peserta yang terdiri dari berbagai SMA/MA di Jabodetabek.</p>\n<p>Kompetisi ini menghadirkan 3 Dewan Juri yang luar biasa, yakni Bpk. ...... Para pemenang dipilih secara langsung oleh 3 Dewan Juri melalui penilaian berdasarkan performa yang mereka tampilkan diatas panggung. SMA 1 Tangerang Selatan keluar sebagai pemenang dalam kompetisi ini, disusul oleh SMA 9 Tangerang Selatan, dan Madrasaah Aliyah Negeri (MAN) 2 Jakarta sebagai Juara 3. Menariknya, sang Juara 1 diberi kesempatan untuk tampil pada acara puncak BOFMAN 4 Part 7 dan berada satu panggung dengan sejumlah Band ternama seperti Nidji, The Banery, Kamar Belakang, dll.</p>\n<p>FYI, bagi kamu yang ingin menyaksikan penampilan memukau dari band-band papan atas, silahkan datang di acara puncak BOFMAN 4 Part 7 yang bertempat di Lapangan Utama MAN 4 Jakarta pada hari Sabtu, 4 September 2015. Acara ini akan dihadiri oleh Nidji, The Banery, Vellarose, Kamar Belakang, dan masih banyak penampilan band-band lainnya. Acara ini juga akan dipandu oleh Rigen (Juara 1 Stand Up Comedy Indonesia Seaseon 5).</p>\n<p>So, bagi kamu yang ingin merasakan euforianya, atau ngga ada kegiatan pada weekend ini, yuk catat tanggal dan waktunya, dijamin kamu ngga bakal nyeselll.</p>', 'news', '0', 'assets/img/news/default-image.png', '2015-08-31 12:02:53', '2015-08-31 12:02:53', NULL),
