(9, 1, 3, 43, 'SELAMAT HUT RI KE-70 Untuk Semua Warga Indonesia', 'SELAMAT HUT RI KE-70, HUT RI KE-70, Indonesia, potensi, nasionalisme, masa depan, negara kita', '<p>Kami ingin mengucapkan SELAMAT HUT RI KE-70 untuk semua warga Indonesia. Semoga diusia Indonesia yang ke-70 ini, Indonesia dapat lebih mengembangkan potensi di dunia industri kreatif!!! Dannnn #SalamKepoAbis ???????????? #HUTRI70<br />#INDONESIA</p>', '<p>Kami ingin mengucapkan SELAMAT HUT RI KE-70 untuk semua warga Indonesia. Semoga diusia Indonesia yang ke-70 ini, Indonesia dapat lebih mengembangkan potensi di dunia industri kreatif!!! Dannnn #SalamKepoAbis ???????????? #HUTRI70<br />#INDONESIA</p>', 'published', '2015-08-17 08:52:53', '2015-09-13 09:10:22', NULL),
