(8, 5, 36, 41, 'Curious Camp (Puncak, 31 Juli 2015 - 2 Agustus 2015)', 'camp, training, games, puncak, kegiatan, erat, solidaritas, permainan', '<p><strong>Bogor, KepoAbis.com</strong> - Ini dia salah satu kegiatan luar biasa yang dijalani oleh crew KepoAbis.com. Yap, Curious Camp, sebuah kegiatan basic training yang ditujukan untuk para crew yang baru bergabung. Pada kegiatan ini, para crew dibekali teori dasar dan praktek seputar videografi, mulai dari tahap Pre Production hingga Post Production bahkan ada pengenalan mengenai sejarah terbentuknya KepoAbis.com. Ngga hanya itu, seluruh crew juga dibekali oleh ilmu Personal Branding, yakni bagaimana caranya menjadi individu yang berkualitas.</p>\n<p>Yang membuat Curious Camp beda dan menarik, disini para crew ngga hanya dibekali oleh teori dan praktek seputar videografi saja, namun para crew juga diajak untuk mengikuti games-games seru. Games ini bukan sembarang games lho kepoers, disini para crew dituntut akan kekompakannya dan kerjasama tim dalam memenangkan games-games tersebut. Setelah rangkaian kegiatan training selesai, diadakan sesi barbeque yang dihibur oleh atraksi berjalan diatas bara api, yang bertujuan untuk mengasah mental seluruh crew yang mengikuti training ini.</p>\n<p>Nah menarik bukan? So, tunggu kegiatan luar biasa dari kami selanjutnya :)</p>', '<p><strong>Jakarta Selatan, KepoAbis.com</strong> - PT. Indosat dan Kepo Abis yang diwakili oleh beberapa anggotanya melakukan liputan dalam acara Launching Product terbaru (Application) PT. Indosat, liputan yang diadakan pada hari sabtu (30/05), di Kebun Binatang Ragunan Jakarta Selatan ini berjalan dengan baik.</p>\n<p>Produced, Directed by KepoAbis.com</p>\n<p><a href="../../../videografi/view/2015/06/19/24/kepoin-event---ragunan-zoo-application">Kepoin Event - Ragunan Zoo Application</a> - <a href=''https://play.google.com/store/apps/details?id=com.inovidea.zooapp''>Download Zoo Application</a></p>', 'published', '2015-08-10 11:37:03', '2015-09-13 09:13:34', NULL),
(15, 1, 36, 105, 'Penampilan Nidji Melengkapi Acara Puncak BOFMAN 4 Part 7', 'Nidji, kepo, The Banery, BOFMAN, band, kompetisi, BOFMAN 4, giring, MAN 4 Jakarta, BOFMAN 4 Part 7', '<p><strong>Jakarta, KepoAbis.com</strong> - Hai Kepoers, rangkaian acara Birthday of MAN 4 (BOFMAN 4) Part 7 telah berakhir kemarin. Acara yang dimulai sejak tanggal 29 Agustus hingga 5 September ini telah diisi dengan berbagai kegiatan seperti bazar makanan dan kompetisi antar SMA/MA (band competition, futsal competition, manga competition, dll).</p>\n<p>Acara puncak BOFMAN 4 Part 7 yang baru saja diselenggarakan kemarin menampilkan sejumlah guest star seperti, Kamar Belakang, D''Luberu, Vellarose, Semut Merah, The Banery, dan ditutup oleh Nidji. Ngga ketinggalan, band SMA 1 Tangerang Selatan juga turut tampil dalam acara ini, sebagai bentuk apresiasi atas predikat juara 1 Marveloustra Competition yang mereka raih pada minggu lalu.</p>\n<p>Penampilan energik dari Nidji merupakan penutup dari acara ini. Lagu Disco Lazy Time yang dibawakan pada akhir penampilan mampu membakar semangat seluruh penonton yang memadati lapangan utama MAN 4 Jakarta. Selebrasi penutupan acara disampaikan langsung oleh Rigen (Juara 1 Stand Up Comedy Indonesia Season 5) yang menandai berakhirnya rangkaian acara BOFMAN 4 Part 7. </p>\n<p>So, sampai ketemu di BOFMAN 4 tahun depan :)</p>', '<p><strong>Jakarta, KepoAbis.com</strong> - Hai Kepoers, rangkaian acara Birthday of MAN 4 (BOFMAN 4) Part 7 telah berakhir kemarin. Acara yang dimulai sejak tanggal 29 Agustus hingga 5 September ini telah diisi dengan berbagai kegiatan seperti bazar makanan dan kompetisi antar SMA/MA (band competition, futsal competition, manga competition, dll).</p>\n<p>Acara puncak BOFMAN 4 Part 7 yang baru saja diselenggarakan kemarin menampilkan sejumlah guest star seperti, Kamar Belakang, D''Luberu, Vellarose, Semut Merah, The Banery, dan ditutup oleh Nidji. Ngga ketinggalan, band SMA 1 Tangerang Selatan juga turut tampil dalam acara ini, sebagai bentuk apresiasi atas predikat juara 1 Marveloustra Competition yang mereka raih pada minggu lalu.</p>\n<p>Penampilan energik dari Nidji merupakan penutup dari acara ini. Lagu Disco Lazy Time yang dibawakan pada akhir penampilan mampu membakar semangat seluruh penonton yang memadati lapangan utama MAN 4 Jakarta. Selebrasi penutupan acara disampaikan langsung oleh Rigen (Juara 1 Stand Up Comedy Indonesia Season 5) yang menandai berakhirnya rangkaian acara BOFMAN 4 Part 7. </p>\n<p>So, sampai ketemu di BOFMAN 4 tahun depan :)</p>', 'published', '2015-09-06 10:59:02', '2015-09-08 09:25:29', NULL),
(14, 1, 36, 104, 'Marveloustra - Kompetisi Band antar SMA/MA Se-Jabodetabek', 'Marveloustra, kepo, Kompetisi, Band, Juri, Juara, BOFMAN 4, MAN 4 Jakarta, BOFMAN, Part 7', '<p><strong>Jakarta, KepoAbis.com</strong> - Hai Kepoers, tau ngga sih kalo kemarin telah diadakan kompetisi band antar SMA Se-Jabodetabek di salah satu SMA di Jakarta. Yap, kali ini Madrasah Aliyah Negeri (MAN 4) Jakarta mengambil peran sebagai salah satu SMA yang turut melestarikan bakat-bakat musik para siswa-siswi SMA di Jabodetabek, dengan menyelenggarakan kompetisi band yang bertemakan Marveloustra. Kompetisi ini merupakan salah satu rangkaian kegiatan dari Birthday of MAN 4 (BOFMAN 4) Part 7, dan diikuti oleh 11 peserta yang terdiri dari berbagai SMA/MA di Jabodetabek.</p>\n<p>Kompetisi ini menghadirkan 3 Dewan Juri yang luar biasa, yakni Denny Setiawan, Diandra, dan Irfan. Para pemenang dipilih secara langsung oleh 3 Dewan Juri melalui penilaian berdasarkan performa yang mereka tampilkan diatas panggung. SMA 1 Tangerang Selatan keluar sebagai pemenang dalam kompetisi ini, disusul oleh SMA 9 Tangerang Selatan, dan Madrasaah Aliyah Negeri (MAN) 2 Jakarta sebagai Juara 3. Menariknya, sang Juara 1 diberi kesempatan untuk tampil pada acara puncak BOFMAN 4 Part 7 dan berada satu panggung dengan sejumlah Band ternama seperti Nidji, The Banery, Kamar Belakang, dll.</p>\n<p>FYI, bagi kamu yang ingin menyaksikan penampilan memukau dari band-band papan atas, silahkan datang di acara puncak BOFMAN 4 Part 7 yang bertempat di Lapangan Utama MAN 4 Jakarta pada hari Sabtu, 5 September 2015. Acara ini akan dihadiri oleh Nidji, The Banery, Vellarose, Kamar Belakang, dan masih banyak penampilan band-band lainnya. Acara ini juga akan dipandu oleh Rigen (Juara 1 Stand Up Comedy Indonesia Season 5).</p>\n<p>So, bagi kamu yang ingin merasakan euforianya, atau ngga ada kegiatan pada weekend ini, yuk catat tanggal dan waktunya, dijamin kamu ngga bakal nyeselll. </p>', '<p><strong>Jakarta, KepoAbis.com</strong> - Hai Kepoers, tau ngga sih kalo kemarin telah diadakan kompetisi band antar SMA Se-Jabodetabek di salah satu SMA di Jakarta. Yap, kali ini Madrasah Aliyah Negeri (MAN 4) Jakarta mengambil peran sebagai salah satu SMA yang turut melestarikan bakat-bakat musik para siswa-siswi SMA di Jabodetabek, dengan menyelenggarakan kompetisi band yang bertemakan Marveloustra. Kompetisi ini merupakan salah satu rangkaian kegiatan dari Birthday of MAN 4 (BOFMAN 4) Part 7, dan diikuti oleh 11 peserta yang terdiri dari berbagai SMA/MA di Jabodetabek.</p>\n<p>Kompetisi ini menghadirkan 3 Dewan Juri yang luar biasa, yakni Denny Setiawan, Diandra, dan Irfan. Para pemenang dipilih secara langsung oleh 3 Dewan Juri melalui penilaian berdasarkan performa yang mereka tampilkan diatas panggung. SMA 1 Tangerang Selatan keluar sebagai pemenang dalam kompetisi ini, disusul oleh SMA 9 Tangerang Selatan, dan Madrasaah Aliyah Negeri (MAN) 2 Jakarta sebagai Juara 3. Menariknya, sang Juara 1 diberi kesempatan untuk tampil pada acara puncak BOFMAN 4 Part 7 dan berada satu panggung dengan sejumlah Band ternama seperti Nidji, The Banery, Kamar Belakang, dll.</p>\n<p>FYI, bagi kamu yang ingin menyaksikan penampilan memukau dari band-band papan atas, silahkan datang di acara puncak BOFMAN 4 Part 7 yang bertempat di Lapangan Utama MAN 4 Jakarta pada hari Sabtu, 5 September 2015. Acara ini akan dihadiri oleh Nidji, The Banery, Vellarose, Kamar Belakang, dan masih banyak penampilan band-band lainnya. Acara ini juga akan dipandu oleh Rigen (Juara 1 Stand Up Comedy Indonesia Season 5).</p>\n<p>So, bagi kamu yang ingin merasakan euforianya, atau ngga ada kegiatan pada weekend ini, yuk catat tanggal dan waktunya, dijamin kamu ngga bakal nyeselll.</p>', 'published', '2015-08-31 14:48:40', '2015-09-07 11:31:01', NULL);
