(1, 0, 'KepoAbis.com', 'b7d6537d27b26a5878d476104cf70186.png', 'Always make you curious', '<p>Kepoabis.com is a videography community based in Jakarta, Indonesia. The embryo of this community was created back in October 2013 by 4 co-founders, Haris Millah Muhammad, Ahmad Khairi, Syahrul Ramadhan, and Herman Wahyudi.</p>\n<p>Our Focus is to create a creative videos which can inspiring people to aplicated to their live what we showed. We also act as a media partner for any client who needs a creative documentation. We commit to give a full service that help our clients expand their digital reach.</p>\n<p>Ã?Â </p>', '#000000', 'Jalan Pelita RT 02/09 No. 69 Kel. Tengah, Kec. Kramat Jati', '085697309204', '', '', '', 'hi@kepoabis.com', 'contact@kepoabis.com', '-6.290491', '106.860785', 'Jakarta Timur', 'DKI Jakarta', '13540', 'Indonesia', 'https://www.facebook.com/kepoabiscom', 'https://twitter.com/KepoAbisCom', 'https://plus.google.com/108330573883645796122', 'https://www.youtube.com/channel/UCjCQDSEsDTqq7wmth70khLQ', 'https://instagram.com/kepoabiscom', 'https://path.com', 'http://ask.fm/kepoabiscom', 'Kepoabis.com is a <strong>videography community</strong>. Our Focus is to create a creative videos which can inspiring people to aplicated to their live what we showed.', '<p>Kepoabis.com is a videography community based in Jakarta, Indonesia. The embryo of this community was created back in October 2013 by 4 co-founders, Haris Millah Muhammad, Ahmad Khairi, Syahrul Ramadhan, and Herman Wahyudi. <br /> <br /> Our Focus is to create a creative videos which can inspiring people to aplicated to their live what we showed. We also act as a media partner for any client who needs a creative documentation. We commit to give a full service that help our clients expand their digital reach.</p>', '<p>To shows an emerging social reality that we pack as a video. <br />To give various entertaining and unique info. <br />Insert a humour value in our video without eliminating the substance of videoâ??s topic.</p>', 'logo.png', '2013', '1.0.0', '<p>Copyright 2013 - 2015 Haamill Productions - All Rights reserved</p>');
INSERT INTO `static_content` (`static_content_id`, `user_id`, `image_id`, `title`, `tag`, `parameter`, `summary`, `body`, `status`, `created_date`, `modified_date`, `deleted_date`) VALUES
(1, 3, 0, 'Our Team', 'Our Team', 'team', '<p><strong>Divisi : Production | </strong><strong>Marketing Communication | </strong><strong>Digital | </strong><strong>Public Relation | </strong><strong>Community</strong></p>', '<p align=justify><strong>Divisi : Production | </strong><strong>Marketing Communication | </strong><strong>Digital | </strong><strong>Public Relation | </strong><strong>Community</strong></p>', 'published', '2015-06-20 17:22:53', '2015-08-20 09:20:26', NULL),
(2, 3, 0, 'Organization', 'Organization', 'organization', '<p><strong><strong>DIVISI</strong></strong></p>\n<p><strong>Production</strong><br /><strong>Marketing Communication</strong><br /><strong>Digital</strong><br /><strong>Public Relation</strong><br /><strong>Community</strong></p>', '<p align=justify><strong>DIVISI</strong><br /><br /></p>\n<p><strong>Production</strong></p>\n<p>Segala sesuatu yang berkaitan dengan produksi (Video editing, campers, property, script writer, sutradara, dll).</p>\n<p> <br /><strong>Marketing Communication</strong></p>\n<p>Bertugas menjalin koneksi dengan perusahaan, mempromosikan kepoabis.com sebagai media partner, analisis calon sponsor dan bertugas mengelola media sosial (fb, twitter, instagram, path).</p>\n<p><br /><strong>Digital</strong></p>\n<p>Dibagi menjadi 2: Design & Website :</p>\n<p>Bertanggung jawan dalam membuat desain baik itu desain pra produksi, produksi ataupun post produksi (Desain) dan mengelola website (Website).</p>\n<p><br /><strong>Public Relation</strong></p>\n<p>Bertugas dalam hal surat-menyurat (surat izin, surat undangan untuk eksternal, dll, nge-blast email untuk eksternal, membuat aturan komunitas.</p>\n<p><br /><strong>Community</strong></p>\n<p>Dibagi menjadi 2: Internal & Eksternal :</p>\n<p>Menyelenggarakan Team Building, Basic Training, Meeting Rutin, Menyaring anggota baru, bertanggung jawab terhadap SDM (Internal ) dan menyelenggarakan kompetisi video, membuat event sosial, koneksi dengan komunitas lain (Eksternal).</p>\n<p> </p>', 'published', '2015-06-20 17:22:53', '2015-08-18 22:29:27', NULL),
(3, 3, 0, 'History', 'History', 'history', '<p>KepoAbisDotCom atau biasa disebut Kepo Abis adalah komunitas videografi yang menyediakan tempat/wadah dalam bentuk website untuk menampilkan video yang dibuat dan memanfaatkan basic skill dari para anggotanya (misalkan: skill mengolah video, skill membuat website, pengetahuan seputar konsep video yang sedang nge-trend). Komounitas ini dibentuk pertengahan tahun 2013 oleh 4 pendirinya, Haris Millah Muhammad, Ahmad Khairi, Syahrul Ramadhan, dan Herman Wahyudi yang berbasis di Jakarta, Indonesia dengan tujuan awalnya untuk hanya ikut lomba video sampai memiliki ide untuk membuat video kreatif yang dapat menginspirasi orang lain untuk diaplikasikan ke dalam kehidupan mereka dan juga bertindak sebagai media partner untuk setiap rekanan yang membutuhkan dokumentasi kreatif. Kepo Abis adalah nama yang dibuat karena kita ingin orang selalu ingin tahu. Pada awalnya nama Kepo Abis adalah Haamill Production hingga sampai saat ini berubah menjadi Kepo Abis.</p>', '<p align=justify><strong>KepoAbisDotCom</strong> atau biasa disebut Kepo Abis adalah komunitas videografi yang menyediakan tempat/wadah dalam bentuk website untuk menampilkan video yang dibuat dan memanfaatkan basic skill dari para anggotanya (misalkan: skill mengolah video, skill membuat website, pengetahuan seputar konsep video yang sedang nge-trend). Komounitas ini dibentuk pertengahan tahun 2013 oleh 4 pendirinya, Haris Millah Muhammad, Ahmad Khairi, Syahrul Ramadhan, dan Herman Wahyudi yang berbasis di Jakarta, Indonesia dengan tujuan awalnya untuk hanya ikut lomba video sampai memiliki ide untuk membuat video kreatif yang dapat menginspirasi orang lain untuk diaplikasikan ke dalam kehidupan mereka dan juga bertindak sebagai media partner untuk setiap rekanan yang membutuhkan dokumentasi kreatif. Kepo Abis adalah nama yang dibuat karena kita ingin orang selalu  ingin tahu. Pada awalnya nama Kepo Abis adalah Haamill Production hingga sampai saat ini berubah menjadi Kepo Abis.<br /><br />Kepo Abis tidak hanya untuk orang yang ahli saja, melainkan untuk orang-orang minat dan berkemauan yang kuat dalam bidang sinematografi/videografi dari segala umur dan latar belakang. Selain itu kita bisa menghasilkan materi dari bidang yang kita ingin geluti ini. Contoh materi yang kita bisa capai ; Google Adsense, YouTube Partner, Iklan web, Promosi Produk, Video Comprof, dll. Sampai saat ini anggota dari komunitas kami berjumlah 42 orang (SMA, Kuliah & kerja).<br /><br /><strong>VISI</strong><br /><br />Menjadi komunitas digital yang gak Cuma unik, menghibur tapi kritis, nyeleneh tapi inspiratif, dan tentunya “up to date”.<br /><br /><strong>MISI</strong><br /><br />Menampilkan gambaran dari realita sosial yang kita kemas secara kritis.<br />Memberikan beragam info unik dan menghibur.<br />Menyisipkan nilai humor tanpa menghilangkan substansi dari tema video.<br /><br /><strong>SERVICE</strong><br /><br />Media Partner<br />Video company profile<br />Video promosi<br />Video pre wedding/wedding<br /><br />“Always make you curious” TAGLINE<br /><br /><br /></p>', 'published', '2015-06-20 17:22:53', '2015-08-22 23:39:48', NULL),
(4, 3, 0, 'Behind the Scene', 'Kepo, Abis, Behind the Scene', 'behind-the-scene', '<h1><strong>KepoAbis.com</strong></h1>', '<p align=justify><h4>Di balik layar <strong>KepoAbis.com</strong></h4></p>', 'published', '2015-08-22 00:00:00', '2015-08-22 23:55:43', NULL);
