(5, 3, '2', 8, 'like, father, daughter, keluarga, orang tua, pendidikan', 'Like Father Like Daughter', '<p>...</p>', 'Haaris Millah M', 'Haaris Millah M', 'Haaris Millah M', 'Haaris Millah M', 'Haaris Millah M', '<p>...</p>', '...', 'Haaris Millah M', 'https://www.youtube.com/watch?v=lbYbFmG7eu0', '01:39', 'published', '2014-04-25 14:02:38', '2015-09-12 23:48:52', NULL),
(6, 3, '7', 12, 'Intro, kepoAbis.com, Short Movie, Documenter, Traveling, Education, Entertainment, Experimental, Vlogger, Serba-serbi, Kepo Abis, Haamill Productions', 'Intro KepoAbis.com', '<p >Seni merupakan suatu wadah untuk menyalurkan hobi dan juga kreativitas manusia yang di lakukan dengan tujuan untuk memberikan sebuah hiburaan, keindahan serta rasa ketertarikan bagi pelaku seni maupun orang yang menikmatinya, salah satu unsur seni yang sering kita jumpai dalam masyarakat adalah dalam bentuk audio visual. Selain itu kecenderungan masyarakat untuk memanfaatkan teknologi sebagai media berekspresi melahirkan beragam bentuk seni yang menghibur, inovatif dan juga inspiratif dimana dibentuk dalam sebuah tayangan yang menarik. Dan, perkembangan era digital saat ini memicu kami untuk membuat sebuah sarana berbagai informasi menarik dan juga kreatif yang dikemas dalam bentuk audio visual. </p>\r <p >Tujuan kami adalah Menjadi komunitas digital yang tidak hanya unik, namun menghibur tetapi kritis, nyeleneh, tetapi inspiratif, dan tentunya "up to date".</p>\r <p >Jadi kepoers let''s join us and enjoy our video! @KepoAbisCom via http://kepoabis.com</p>', 'Haaris Millah M', 'Haaris Millah M', 'Haaris Millah M', 'Haaris Millah M', 'Haaris Millah M', '<p>Ahmad Khairi N L, Herman Wahyudi, Haaris Millah M, Syahrul Ramadhan</p>', '...', 'Haaris Millah M', 'https://www.youtube.com/watch?v=TjBvuQ_Qj-0', '22:12', 'published', '2014-04-21 12:58:46', '2015-07-21 03:15:27', NULL),
(7, 3, '8', 5, 'Ace Hardware (Organization), Indonesia (Country), Kepo, Abis,  Kepoabis, Video, Bangsa, Pembangunan, Negeri, Kepo Abis', 'Ace Hardware untuk Indonesia - ACE Hardware Video Competition', '<p >Indonesia kaya akan alamnya, juga kaya akan budayanya. Bersatu padu membangun ibu pertiwi agar tradisi dan budaya tetap dijunjung tinggi. Ace Hardware untuk Indonesia. @KepoAbisCom via http://kepoabis.com</p>', 'Haaris Millah M', 'Haaris Millah M, Syahrul Ramadhan, Ahmad Khairi N L, Herman Wahyudi', 'Herman Wahyudi', 'Haaris Millah M', 'Haaris Millah M', '<ul>\n<li>Ahmad Khairi N L</li>\n<li>Syahrul Ramadhan</li>\n</ul>', '-', 'Haaris Millah M', 'https://www.youtube.com/watch?v=VjN4Xl3DN_I', '01:22', 'published', '2014-03-28 08:48:35', '2015-08-24 07:49:12', NULL),
(8, 3, '1', 7, 'enjoy jakarta, enjoy your day, jakarta, kepo abis, indonesia, macet, traffic jam, tips, tutorial', 'Enjoy Jakarta Enjoy Your Day, Nikmati Caramu', '<p>Pada suatu hari ada seorang lelaki yang ingin mengunjungi pacarnya yang tinggal di Jakarta. Tapi ketika sampai di Jakarta, yang dijumpai hanyalah macet. Kemudian, beliau mencoba menikmati macet dengan caranya sendiri. Di video ini beliau memberitahu tips-tips yang sangat berguna ketika anda menghadapi macet.</p>\n<p>Macet?. gak usah stres, nikmati dengan caramu sendiri.</p>', 'Haaris Millah M', 'Haaris Millah M, Syahrul Ramadhan, Ahmad Khairi, Herman Wahyudi', 'Haaris Millah M, Syahrul Ramadhan, Ahmad Khairi, Herman Wahyudi', 'Haaris Millah M, Syahrul Ramadhan, Ahmad Khairi, Herman Wahyudi', 'Haaris Millah M', '<ul>\n<li>Ahmad Khairi (Orang Jakarta)</li>\n<li>Syahrul Ramadhan (Pengamen)</li>\n<li>Herman Wahyudi (Penjual Koran/Kamus)</li>\n</ul>', 'Haaris Millah M', 'Haaris Millah M', 'https://www.youtube.com/watch?v=dg_IomGAkmU', '01:11', 'published', '2014-04-25 11:26:46', '2015-08-23 21:34:21', NULL),
