(14, 3, '6', 11, 'Film Pendek, Short Movie, Film, Drugs, Police, Polisi, Pengedaran Narkoba, Narkoba', 'Jeruji Besi', '<p >Cerita ini bermula ketika seorang suami yang bernama Yogi yang menjadi suspek pengedaran dadah dan telah dimasukan kedalam penjara. Ia merasa menyesal dan teringat semula dengan kejadian yang telah berlaku sebelumnya.</p>\r <p >Yogi dan Santi adalah sepasang suami isteri yang telah menikah setahun lepas. Mereka tinggal berdua di rumah yang sederhana. Yogi merupakan suami yang tidak memiliki pekerjaan, atau biasa disebut pengangguran.</p>\r <p >Pada suatu hari sang istri sudah bosan dan geram terhadap suami yang tidak juga mendapatkan pekerjaan dan sang istri cuba memprotes suaminya. Tetapi sang suami memarahinya semula. </p>\r <p >Akhirnya sang suami pergi meninggalkan rumah untuk mencari pekerjaan dan membuktikan kepada isterinya bahawa dia boleh mendapatkan pekerjaan dan wang. Tetapi pekerjaan yang dipilih oleh suami adalah salah. Dia lebih memilih jalan pintas untuk mendapatkan wang dengan cara haram, iaitu menjadi pengedar dadah. Selama suami menjadi seorang pengedar, sang isteri tidak pernah tahu bahawa suaminya adalah seorang pengedar. </p>\r <p >Masalah datang ketika sang suami melakukan rasuah daripada hasil penjualan dadah. Selain itu semasa sang suami menjadi pengedar dadah dia telah diekori oleh dua orang polis. Selepas itu apa yang akan berlaku ketika sang suami menghadapi kedua-dua masalah ini?. Dapatkah dia melaluinya?.</p>', 'Haaris Millah M', 'Haaris Millah M', 'Haaris Millah M', 'Haaris Millah M', 'Haaris Millah M', '<p>• Raja Yogi Ardiansyah sebagai Suami</p>\r\n<p>• Santika Aznar Juliawati sebagai Isteri</p>\r\n<p>• Fathur sebagai Bos pengedar</p>\r\n<p>• Arifin sebagai Pengedar 1</p>\r\n<p>• Rachmat Hidayat Mustamin sebagai Pengedar 2</p>\r\n<p>• Iyan Hamka sebagai Pengedar 3</p>\r\n<p>• Ali Khaidir sebagai Polis 1</p>\r\n<p>• Akbar Arief sebagai Polis 2</p>', '...', 'Haaris Millah M', 'https://www.youtube.com/watch?v=T0O-zde6U9I', '11:35', 'published', '2014-04-24 12:44:22', '2015-07-21 03:20:20', NULL),
