(25, 3, '8', 40, 'event, N3TS School Exhibition, school, sekolah, tangerang selatan, pensi, exhibition, music, sport, SMAN 3 Tangerang Selatan', 'Kepoin Event - N3TS School Exhibition', '<p>Hello Kepoers, </p>\n<p>Ini adalah salah satu liputan Kepoin Event di SMAN 3 Tangerang Selatan dalam acara N3TS School Exhibition!</p>\n<p>Langsung aja nih ditonton videonya</p>\n<p> </p>\n<p>Produced, Directed by KepoAbis.com</p>\n<p>https://www.youtube.com/channel/UCjCQDSEsDTqq7wmth70khLQ</p>\n<p> </p>\n<p>FACEBOOK : http://www.facebook.com/kepoabiscom</p>\n<p>TWITTER: http://twitter.com/kepoabiscom</p>\n<p>INSTAGRAM: @kepoabiscom</p>\n<p>EMAIL: haamill.productions@gmail.com</p>\n<p> </p>\n<p>Jangan lupa untuk Like and Subscribe yaa kepoers!!</p>\n<p>Sampai jumpa di vlog kami berikutnya.</p>\n<p>KepoAbis.com, Always make you curious...</p>', 'Haaris Millah M', '...', 'Annisa Sedjati, Muthia Anggita Ramadhani, Syarah Nabilah', 'Mohammad Zulfikar Alfiansyah', 'Haaris Millah M, Mohammad Iqbal, Ahmad Rayhan Addawa, Muhammad Fadhlirahman, Adil Azka Dhiyaan Fadhlur, Muhammad Zaidan Amir, ', '<p>...</p>', '...', 'Haaris Millah M', 'https://www.youtube.com/watch?v=eyTEU65RHf4', '06:35', 'published', '2015-06-19 13:36:08', '2015-09-12 23:45:03', NULL),
(26, 3, '11', 32, 'travel, japan, liburan, luar negeri, perjalanan', 'Kepoin Travel - JAPAN', '<p>Hello Kepoers,</p>\n<p> </p>\n<p>Negeri Sakura</p>\n<p>Ya, betul sekali Jepang!!</p>\n<p>Untuk pertama kalinya Kepoabis.com membuat Kepoin Travel!!</p>\n<p>Dan salah satu crew kami yaitu Fadhli bakal ngajak kita jalan jalan ke Jepang kepoers!!</p>\n<p> </p>\n<p>Mau tau perjalanannya?</p>\n<p>Tonton yuk videonya:D</p>\n<p> </p>\n<p>Produced, Directed by KepoAbis.com</p>\n<p>https://www.youtube.com/channel/UCjCQDSEsDTqq7wmth70khLQ</p>\n<p> </p>\n<p>FACEBOOK : http://www.facebook.com/kepoabiscom</p>\n<p>TWITTER: http://twitter.com/kepoabiscom</p>\n<p>INSTAGRAM: @kepoabiscom</p>\n<p>EMAIL: haamill.productions@gmail.com</p>\n<p> </p>\n<p>Jangan lupa untuk Like and Subscribe yaa kepoers!!</p>\n<p>Sampai jumpa di vlog kami berikutnya.</p>\n<p>KepoAbis.com, Always make you curious...</p>', 'Haaris Millah M', 'Mohammad Zulfikar Alfians', '...', 'Mohammad Zulfikar Alfians', 'Faris Pradiatma', '<p>Ahmad Rayhan Addawa, Muhammad Zaidan Amir, Muhammad Fatahillah Hendrawan</p>', 'Ahmad Rayhan Addawa, Muhammad Zaidan Amir, Muhammad Fatahillah Hendrawan', 'Adil Azka Dhiyaan Fadhlur', 'https://www.youtube.com/watch?v=w8-G0nISX9U', '07:21', 'published', '2015-06-21 20:04:36', '2015-09-12 23:47:35', NULL),
(28, 3, '8', 42, 'Greeting HKN, Hari Komunitas, Nasional, KepoAbis.com, Kepo, Abis, Kepo Abis', 'Video Greeting HKN 2015 - KepoAbis.com', '<p>Video Greeting @WikiDPR. Kita turut berpartisipasi, berkolaborasi dan berkarya menyambut Hari Komunitas Nasional 2015 #ActionForNation #ICN2015</p>', 'Haaris Millah M', '...', '...', '...', 'Syahrul Ramadhan, Mohammad Iqbal', '<p>Semua anggota KepoAbis.com</p>', 'Ahmad Rayhan Addawa', 'Haaris Millah M', 'https://www.youtube.com/watch?v=XrBI9x6AIUw', '01.00', 'published', '2015-08-13 09:12:49', '2015-09-12 23:52:45', NULL),
(32, 42, '8', 48, 'Promotion, Kepo, Abis, KepoAbis.com, Kepo Abis, MAN 4 Jakarta', 'Eksrajition 2015', '<p>Halo Kepoers!</p>\n<p>Berikut ini video promosi acara <strong>Ekrajition 2015</strong></p>\n<p>Jangan lupa dateng ke acara ini Hari Sabtu, 22 Agustus 2015</p>\n<p>Di PSBB MAN 4 Jakarta</p>\n<p> </p>\n<p>#SalamKepoAbis</p>', 'Haaris Millah Muhammad', 'Mohammad Zulfikar Alfiansyah', 'Mohammad Zulfikar Alfiansyah', '-', '-', '', '-', 'Haaris Millah Muhammad', 'https://www.youtube.com/watch?v=Ad-V-Bzp98E', '00:26', 'published', '2015-08-17 14:10:29', '2015-09-12 23:52:21', NULL),
(30, 3, '10', 45, 'Documenter, Kepo, Abis, Kepoabis, Kepo abis, Bela, Negara, Hut, 70, RI', 'Selamat Hari Kemerdekaan Indonesia yang ke-70', '<p>Halo Kepoers!</p>\n<p> </p>\n<p>Selamat Hari Kemerdekaan Republik Indonesia ke 70 kepoers!</p>\n<p><br />#SalamKepoAbis</p>', 'Haaris Millah Muhammad', 'Haaris Millah Muhammad', 'Ahmah Khairi Nawawi Lubis', 'Iqbal Hussein', 'Haaris Millah Muhammad', '', 'Ahmad Khairi Nawawi Lubis', 'Haaris Millah Muhammad', 'https://www.youtube.com/watch?v=CPloBZ_GXPg', '05:54', 'published', '2015-08-17 09:38:58', '2015-08-29 20:11:51', NULL),
(34, 3, '8', 88, 'Birthday of MAN 4, MAN 4 Jakarta, Bofman, Guest Star, Bofman 4, Part 7, 2015', 'Birthday of MAN 4 (BOFMAN 4) part 7 2015 - Guest Star', '<p>Dalam rangka merayakan ulang tahunnya, MAN 4 Jakarta mengadakan Birthday of MAN 4 (BOFMAN 4) PART 7. Ini adalah Acara tahunan yang diselenggarakan oleh OSIS/PPK MAN 4 Jakarta dan akan hadir Pentas Seni (Pensi) yang akan menghadirkan Guest Star. Penasaran ...</p>\n<p><strong>RIGEN (MC) | NIDJI | D''LUBERU | THE BANERY | VELLAROSE | SEMUT MERAH | KAMAR BELAKANG</strong></p>\n<p>Berikut ini video promosi acara Brithday Of MAN (BOFMAN)<br /><br />Jangan lupa dateng ke acara ini mulai Hari Sabtu s/d Sabtu, 29 Agustus 2015 - 5 September 2015.<br /><br />Di MAN 4 Jakarta, GOR UIN, dan SAG Pamulang.<br /><br />#SalamKepoAbis</p>', 'Haaris Millah M', '-', '-', '-', '-', '<p>-</p>', '-', 'Haaris Millah M', 'https://www.youtube.com/watch?v=oejrNRf3YxI', '01:07', 'published', '2015-08-24 09:57:24', '2015-08-27 20:04:17', NULL),
(35, 3, '8', 89, 'MAN 4 Jakarta, Bofman, Birthday of Man 4, Brithday, Of, MAN 4, Bofman 4, part 7, 2015', 'Birthday of Man 4 (BOFMAN 4) 2015', '<p>Birthday of MAN 4 (BOFMAN 4) PART 7 2015.  Yuk ikutin acaranya banyak berbagai perlombaan dan pertandingan disana. Seperti <em><strong>Marveloustra, Really Photo, AL-INS CUP, Manga Vocal Jepang, 4th ALMODE CUP, I - Tech Competition, MAN 4 Open dan WAR-E</strong></em><br /><br />Selain itu tentu saja akan hadir Pentas Seni (Pensi) yang akan menghadirkan Guest Star. Dibawah ini :</p>\n<p><em><strong>RIGEN (MC) | NIDJI | D''LUBERU | THE BANERY | VELLAROSE | SEMUT MERAH | KAMAR BELAKANG</strong></em><br /><br />Jangan lupa dateng ke acara ini mulai Hari Sabtu s/d Sabtu, 29 Agustus 2015 - 5 September 2015.<br /><br />Di MAN 4 Jakarta, GOR UIN, dan SAG Pamulang.</p>\n<p>#SalamKepoAbis</p>', 'Haaris Millah M', '-', '-', '-', '-', '<p>-</p>', '-', 'Haaris Millah M', 'https://www.youtube.com/watch?v=Jv_5GDolIVs', '02:01', 'published', '2015-08-26 08:04:08', '2015-08-27 20:03:50', NULL),
(38, 42, '1', 106, 'Event, Videografi, Cinematografi, Eksrajition 2015, Saman, Competition, Eksrajition, MAN 4 Jakarta', 'Eksrajition 2015 - Saman Competition', '<p>Halo kepoers,</p>\n<p> </p>\n<p>Liat yuk video acara Eksrajition 2015 yang di adakan oleh MAN 4 Jakarta</p>\n<p> </p>\n<p>Jangan lupa juga mampir ke Social Media kita dan juga Subscribe, Like, Comment video ini yaa!</p>\n<p> </p>\n<p>#SalamKepoAbis</p>', 'Haaris Millah Muhammad', '', 'Zulfikar Alfiansyah', 'Rayhan Addawa', 'Zaidan Amir, Jafar Shadiq, Amadea', '', '', 'Haaris Millah Muhammad', 'https://www.youtube.com/watch?v=C4Zq83YlKJs', '02:38', 'published', '2015-09-08 20:28:43', '2015-09-08 22:55:46', NULL),
(37, 3, '8', 91, 'Bofman 4, Bofman, MAN 4 Jakarta, BOFMAN4 Part7, competition, futsal, manga, itech, fotografi', 'BOFMAN4 PART 7: Competition', '<p>Hallo Kepoers!! Udah tau kan kalo MAN 4 Jakarta akan mengadakan kegiatan spektakuler mulai tanggal 29 Agustus-5 September 2015. Yap, kegiatan ini dinamakan BOFMAN 4 (Part 7). Kegiatan ini diselenggarakan dalam rangka memperingati hari ulang tahun MAN 4 lho Kepoers. Nah selain mendatangkan Guest Star yang ngehits, BOFMAN4 Part 7 ini juga mengadakan berbagai kegiatan menarik, seperti Bazaar Creative, Saman Performance, dan yang ngga kalah penting adalah BOFMAN4 Part 7 Competition.</p>\n<p>Nah kita kasih bocoran ni mengenai BOFMAN4 Part 7 Competition. Disini ada berbagai perlombaan yang akan diselenggarakan, mulai dari bidang seni, olahraga, dan juga teknologi. Penasaran apa aja perlombaannya? Yuk langsung aja saksikan videonya :)</p>\n<p>#SalamKepoAbis</p>', 'Haaris Millah M', '', '', '', '', '', '', 'Adil Azka Dhiyaan Fadhlur', 'https://www.youtube.com/watch?v=SsYJ1YLYmFA', '02:55', 'published', '2015-08-27 01:31:53', '2015-08-28 08:26:02', NULL);
